description:
Mandela Remembered from Westminster Abbey

Sociopolitical Documentary hosted by David Dimbleby, published by BBC in 2014 - English narration


Information
------------------------------

Live from Westminster Abbey, Archbishop Desmond Tutu, David Cameron and the Soweto Gospel Choir join together in a powerful service to commemorate the extraordinary life of Nelson Mandela, former president of South Africa. Presented by David Dimbleby.

